al:\n\t\tnew1_cat[i]=new1[i].astype(str)\n\n\t# Transform the categorical variables into one-hot encoded form  \n\tcat.fit(new1_cat)\n\tnew1_cat=cat.transform(new1_cat)\n\tone_hot.fit(new1_cat)\n\tresult_dataframe=one_hot.transform(new1_cat)\n\n\t# Join the table: numerical and one-hot encoder \n\tresult = dd.concat([new1_num,result_dataframe],axis=1)\n\tresult = result.compute()\n\n\t# Standardize \n\tstd=StandardScaler()\n\tstd.fit(result)\n\tresult=std.transform(result)\n\n\t# if we want to impute the missingness with mean, you just fill 0s here since our data is standardized \n\tresult=result.fillna(0)\n\n\t# combine the as-is feature and one-hot feature \n\tpath=\"s3://ds102-i-love-dsc102-scratch/cleaned_1/\"\n\tresult = dd.concat([new1_id,result],axis=1)\n\tresult.columns=result.columns.astype(str)\n\toutput = dd.to_parquet(result,path)\n\nif __name__==\"__main__\":\n\tcluster=LocalCluster(dashboard_address=\":9001\")\n\tclient = Client(cluster)\n\twith performance_report(filename=\"dask-report_1.html\"):\n\t\tclean()\n\n\n        &lt;/pre&gt;\n        "},"id":"1346","type":"Div"},{"attributes":{},"id":"1367","type":"AllLabels"},{"attributes":{"below":[{"id":"1325"}],"center":[{"id":"1328"},{"id":"1332"}],"height":150,"left":[{"id":"1329"}],"renderers":[{"id":"1343"}],"sizing_mode":"stretch_both","title":{"id":"1316"},"toolbar":{"id":"1336"},"x_range":{"id":"1211"},"x_scale":{"id":"1321"},"y_range":{"id":"1319"},"y_scale":{"id":"1323"}},"id":"1315","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1361","type":"Title"},{"attributes":{},"id":"1444","type":"Selection"},{"attributes":{"formatter":{"id":"1378"},"major_label_policy":{"id":"1380"},"ticker":{"id":"1013"},"visible":false},"id":"1012","type":"LinearAxis"},{"attributes":{"line_alpha":0.1,"line_color":"blue","x":{"field":"time"},"y":{"field":"write_bytes"}},"id":"1308","type":"Line"},{"attributes":{},"id":"1445","type":"UnionRenderers"},{"attributes":{"line_alpha":0.1,"line_color":"red","x":{"fiel
